import './style/reset.css';
import ReactDOM from 'react-dom';
import Navbar from './components/navbar';
import Footer from './components/footer';

const App = () => {
    return (
        <div>
            <Navbar />
            <Footer></Footer>
        </div>
    );
};

ReactDOM.render(<App />, document.querySelector('#root'));
